type movieType={
    title:string,
    rang:number
    year:number
}[]
const moviedata:movieType = [
    {
        title:"Intertaller",
        rang:10,
        year:2010
    },
    {
        title:"Batman",
        rang:9,
        year:2017
    },
    {
        title:"Marvel",
        rang:7,
        year:2022
    }
]
export default moviedata;
